script: |
  super -f text -I q12850.spq | sort > q12850.out

inputs:
  - name: q12850.spq
    data: |
      SELECT DISTINCT + 64 * - col2 AS col0 FROM tab1 (FORMAT parquet) WHERE col0 NOT BETWEEN 24 + + col0 AND - col2 * + col2;
  - name: tab1

outputs:
  - name: q12850.out
    data: |
      -3776
      -4352
      -6144
